var definebabe = require('../dist').default;

var emily = definebabe.search('dillion harper')

emily.then(function(data){
  definebabe.galleries(data.id, data.slug)
    .then(function(res){
      var rand = res[Math.floor(Math.random() * res.length)]
      definebabe.gallery(rand.id, data.slug)
        .then(function(gallery){
          console.log(gallery);
        })
    })
})
